    temp.Add("yield", YIELD)
    temp.Add("if", IF)
    temp.Add("else", ELSE)
    temp.Add("true", TRUE)
    temp.Add("false", FALSE)
    temp

let lookup word =
    let (result, value) = keywordMap.TryGetValue(word)
    if result
    then value
    else IDENT(word)

